$(document).ready(function(){$('a[href*="#"]:not([href="#"]):not([href="#release-notes"])').click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var a=$(this.hash);a=a.length?a:$("[name="+this.hash.slice(1)+"]");if(a.length){$("html, body").animate({scrollTop:a.offset().top},1000);return false}}});$.ajax({type:"GET",url:"https://api.github.com/repos/AntumDeluge/debreate",dataType:"json",success:function(a){$("#github-stars").append(a.stargazers_count);$("#github-forks").append(a.forks)}});$.ajax({type:"GET",url:"https://api.github.com/repos/AntumDeluge/debreate/releases/latest",dataType:"json",success:function(d){var b="https://github.com/AntumDeluge/debreate";var a="debreate_"+d.name+"_all.deb";var c=d.tag_name+".zip";var e=d.tag_name+".tar.gz";$(".link-deb").attr("href",b+"/releases/download/"+d.tag_name+"/"+a).text(a+" (deb)");$(".link-zip").attr("href",b+"/archive/"+c).text(c+" (zip)");$(".link-targz").attr("href",b+"/archive/"+e).text(e+" (tar.gz)")}});$.ajax({type:"GET",url:"https://api.github.com/repos/AntumDeluge/debreate/contributors",dataType:"json",success:function(a){$.each(a,function(b,c){$("#contributors-list").append('<div class="contributor card"><img src="'+a[b].avatar_url+'"><p><a href="'+a[b].html_url+'" class="contributor-login">'+a[b].login+"</a><br>"+a[b].contributions+" contribution"+((a[b].contributions>1)?"s":"")+"</p></div>")})}});$("#faqs dd").hide();$("#faqs dt").click(function(){$(this).next("#faqs dd").slideToggle(500);$(this).toggleClass("expanded")})});